import React from "react";

export default function Footer() {
  return (
    <footer className="text-white text-dark bg-warning p-5 mt-5 text-center">
      <div className="container">
        <p>Teste para canditado Oficina5 - Lucas Garcia</p>
        <p>2019</p>
      </div>
    </footer>
  );
}
